import axios from "axios";
import React, {Component} from "react";

class Bill extends Component {
    constructor(props) {
        super(props);
        this.state = {
            response: '',
            data: '',
            searchValue: '',
        }
    }

    componentDidMount() {
        let params = {
            "action": "wbsearchentities",
            "language": "en",
            "format": "json",
            "search": "Bill Clinton",
            "origin": "*",
            "limit": 5
        }

        let url = "https://www.wikidata.org/w/api.php";

        axios.get(url, {params: params}).then(result => {

            console.log('axios result ===> ', result);
            console.log(result.data.searchinfo.search);
            this.setState({response: result.data, search: result.data.search, searchValue: result.data.searchinfo.search})
        }).catch(err => console.log('axios error ===> ', err));

    }

    render() {
        return (
            <>
                <div>
                    <table className="table">
                        <thead>
                        <tr>
                            <th scope="col">#</th>
                            <th scope="col">{this.state.searchValue}</th>
                            <th scope="col">Last</th>
                            <th scope="col">Handle</th>
                        </tr>
                        </thead>
                        <tbody>
                        <tr>
                            <th scope="row">1</th>
                            <td>Mark</td>
                            <td>Otto</td>
                            <td>@mdo</td>
                        </tr>
                        <tr>
                            <th scope="row">2</th>
                            <td>Jacob</td>
                            <td>Thornton</td>
                            <td>@fat</td>
                        </tr>
                        <tr>
                            <th scope="row">3</th>
                            <td>{this.state.search && this.state.search.map((element) => (
                                <>
                                    <p>{element.id}</p>
                                    <p>{element.display.description.value}</p>
                                </>
                            ))}</td>
                            <td>the Bird</td>
                            <td>@twitter</td>
                        </tr>
                        </tbody>
                    </table>

                    <table style={{border: '1px solid green'}}>
                        <tr><td size="100px">{this.state.searchValue}</td><td></td><td></td>{this.state.search && this.state.search.map((element) => (
                            <>
                                <p>{element.id}</p>
                                <p>{element.display.description.value}</p>
                            </>
                        ))} <td></td></tr>
                    </table>
                    {/*{this.state.response.search.length}*/}



                </div>

            </>
        )
    }
}

export default Bill;
